import React from "react";
import search from "../../images/search.png";
import notefic from "../../images/notification.png";
import profilpic from "../../images/mheader.png";
function Info(  ) {
  return (
    <nav>
      <h1>
        Overview
      </h1>
        <div className="nav-items">
          <img src={search} alt="" />
          <img src={notefic} alt="" />
          <span className="arrow"></span>
          <h1>Jones Ferdinand
          </h1>
            <div className="img-rounder">
                <img src={profilpic} alt="" />
            </div>
        </div>
    </nav>
  );
}

export default Info;
